export const ProkemonDataView = ({ pokemon }) => {
  return (
    <div>
      <img
        src={pokemon.sprites.other["official-artwork"].front_default}
        alt={pokemon.name}
        width="240"
      />
      <h2>{pokemon.name}</h2>
      <ul>
        {pokemon.map((poke) => (
          <li key={poke.stat.name}>
            {poke.stat.name}: {poke.base_stat}
          </li>
        ))}
      </ul>
    </div>
  );
};
